import React from "react";
import { Container } from "react-bootstrap";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";

const HeaderBasket = () => {
  return (
    <Container>
      <div className="bg-body-secondary d-flex justify-content-between px-3 align-items-center">
        <Form className="">
          <Form.Group className="mb-3 d-flex align-items-center" id="formGridCheckbox" >
            <Form.Check type="checkbox" label="Check me out" className="p-3" />
          </Form.Group>
        </Form>
        <Button variant="secondary" >
          Submit
        </Button>
      </div>
    </Container>
  );
};

export default HeaderBasket;
